function findHighAccessEmployees(access_times: string[][]): string[] {
    const highAccessEmployees = new Set<string>();

    // Group times by employee
    const employeeAccessTimes: { [key: string]: number[] } = {};
    for (const [employee, accessTime] of access_times) {
        const time = parseInt(accessTime.substring(0, 2)) * 60 + parseInt(accessTime.substring(2, 4));
        if (!employeeAccessTimes[employee]) {
            employeeAccessTimes[employee] = [];
        }
        employeeAccessTimes[employee].push(time);
    }

    // Check for high-access within each group
    for (const employee in employeeAccessTimes) {
        const times = employeeAccessTimes[employee].sort((a, b) => a - b);
        for (let i = 0; i < times.length - 2; i++) {
            if (times[i + 2] - times[i] < 60) {
                highAccessEmployees.add(employee);
                break;
            }
        }
    }

    return Array.from(highAccessEmployees);
}
